import React from 'react';
import {View, Text, StyleSheet,Image} from 'react-native';

export default function notifCard(props){
    const {data}=props;
    return (
        <View style={styles.card}>
            <Image source={require("../assets/logokien-signup.8641c4b2.png")}></Image>
            <Text>Some text</Text>
        </View>
    )
}

const styles=StyleSheet.create({
    card:{
        flex:1,
        padding:10,
        elevation:1,
        borderBottomWidth:2,
        borderColor:"gray",
        flexDirection:"row",
        justifyContent:"flex-start"
    },
    image:{
        height:"100%"
    },
    
})
